import React from 'react';
import { AppBar, Toolbar, Container, Avatar, Typography, Menu, MenuItem } from '@mui/material';

const pages = ['Home', 'Menu', 'Reservation', 'Contact', 'My Account'];

const NavBar = () => {
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <AppBar position="static" sx={{ backgroundColor: 'transparent'}}>
      <Container maxWidth="xl">
        <Toolbar>
          <div style={{ display: 'flex', alignItems: 'center' }}>
            <Avatar 
              alt="Logo" 
              src={`logo.png`} 
              sx={{ width: '6rem', paddingTop: '1rem'}}
            />
            <Typography
              variant="h6"
              sx={{ 
                color: 'black',
                fontSize: '1.5rem',
                fontFamily: 'Knewave',
                marginLeft: '1rem',
              }}
            >
              RELAXING KOALA
            </Typography>
          </div>
          <div>
            <Menu
              anchorEl={anchorEl}
              open={Boolean(anchorEl)}
              onClose={handleClose}
            >
              {pages.map((page) => (
                <MenuItem key={page} onClick={handleClose}>
                  {/* Replace '#' with the actual URL path to each page */}
                  <a href={`#${page}`} style={{ textDecoration: 'none', color: 'inherit' }}>
                    <Typography textAlign="center" color="black">{page}</Typography>
                  </a>
                </MenuItem>
              ))}
            </Menu>
          </div>
        </Toolbar>
      </Container>
    </AppBar>
  );
}

export default NavBar;
